import { Container, Navbar, Nav } from 'react-bootstrap';
import "../styles/navbar.scss";
import logo from "../images/Logo.svg";
import sign from "../images/Sign.svg";
import { BrowserRouter as Router, Link, NavLink } from 'react-router-dom';

export default function NavbarComponent() {
  return (
    <Navbar collapseOnSelect expand="lg" bg="light" >
      <Container>
        <Navbar.Brand as = {Link} to="/"><img className="logo" src={logo} alt="logo" /></Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link  as = {Link} to="/movies">Movies</Nav.Link>
            <Nav.Link as = {Link} to="/news" >News</Nav.Link>
            <Nav.Link as = {Link} to="/details" >Details</Nav.Link>
          </Nav>
          <Nav className="logs">
            <span><img className="sign" src={sign} alt="sing in/up" /></span>
            <Nav.Link as = {Link} to="/singup" id="signin" >Sign in</Nav.Link>
            <span className="bar">/</span>
            <Nav.Link as = {Link} to="/singin" id="signup" >Sign up</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
      // <ul>
      //   <li>
      //     <Link to="/">Test</Link>
      //   </li>
      //   <li>
      //     <Link to="/blog">Blog</Link>
      //   </li>
      //   <li>
      //     <Link to="/about">About</Link>
      //   </li>
      //   </ul>
  );
}
